    const MAX_SIMUL = 3 || 1;

    function run(current) {
        const remaining = partners.length - current;
        let html = '<html><head></head><body>';
        for (let i = 0; i < MAX_SIMUL && i < remaining; ++i) {
            const partner = partners[current + i];
            const url = partner.url;

            html += url;
        }

        html += '</body></html>';

        const iframe = document.createElement('iframe');

        iframe.srcdoc = html;
        iframe.height = 0;
        iframe.width = 0;

            setTimeout(run.bind(this, current + MAX_SIMUL), WAIT_MS);
        }
